import React from "react";

const About = () => {
  return (
    <>
      <div className="container-fluid bg-secondary">
        <div className="row">
          <div className="col-md-8 mx-auto">
            <img
              src="/images/logo-banner-dark.png"
              alt=""
              className="img-fluid rounded"
              style={{ width: "100%" }}
            />
          </div>
        </div>
      </div>
    </>
  );
};

export default About;
